import React from 'react';

const Card = (props) => {
  return(
    <div className="bg-light-green dib order br3 pa3 mab grow bw2 shadow-5">
      <img alt="Foto Robot" src="https://robohash.org/{props.id}?200x200" />
      <div>
        <h2>{props.name}</h2>
        <p>janedoe@gmail.com</p>
      </div>
    </div>
  );
}


export default Card;
